description:
On a day with gentle rain, many of these small  Ringlet butterflies clinging to grass stalks.  Must be the first flight; according to Scott the larvae hibernate in the first stage.

"He said: I search for butterflies that sleep among the wheat;

and make them into muttonpies, and sell them on the street.

i sell them unto men who sail the stormy seas;

and that's the way i make my bread; a trifle, if you please."

--Lewis Carroll
